(1, 'pair of Military Macaws', '<p>pair of Military Macaws they are about 6 and 12 yrs old They are fully feathered and do not pluck can be handled Will consider trade for baby macaw.</p>\r\n', 6, 18, 1, 20, '2013-04-01', '0000-00-00', 2, 2, 1, 'Gateway Boulevard', 'test', 'test', 'test', 'test', 'test', 'test', 'test', 'test', '', 0, 1, 0, '2013-04-29', 0),
(2, 'Jumbo Brown Cortunix Quail Chicks For Sale ', '<p>\r\n	They are a very good bird for the beginners to start with as they are very easy to raise and keep. They are a very good layer and are good for meat and the eggs can be used for pickling These small birds do not necessarily require a large pen and they are not expensive to feed. Hard to believe these five day old Jumbo Brown Coturnix Quail Chicks will be laying eggs in 6 to 7 weeks!!!</p>\r\n', 6, 18, 1, 20, '2013-04-02', '0000-00-00', 2, 1, 1, 'Gateway Boulevard', 'test', 'test', 'test', 'test', 'test', 'test', 'test', 'test', '', 0, 1, 0, '2013-04-29', 0),
(3, 'Hand-tame Baby Cobalt Lineolated Parakeet ', '<p>\r\n	Beautiful, hand-tamed, hand-fed, Cobalt Lineolated Parakeet ready for a new home.</p>\r\n', 6, 18, 1, 20, '2013-04-01', '0000-00-00', 8, 2, 0, 'Gateway Boulevard', '', '', '', '', '', '', '', '', '', 200, 1, 0, '2013-04-29', 0),
(4, 'Recumbent Trike/GreenSpeed Anura ', '<p>\r\n	Like New Green Speed Anura recumbent Trike. Like New. 16 inch wheels. Silver...adjustable length. Please serious inquiries only. Picture not the best as it is stored in my basement.</p>\r\n', 1, 9, 1, 20, '2013-04-01', '0000-00-00', 2, 2, 1, 'Gateway Boulevard', 'test', 'TEST', 'test', 'testq', 'test', 'tes', 'test', 'tes', '', 0, 1, 1, '2013-04-29', 0),
(5, '2012 Fuji Nevada 2.0 Mountain Bike (Like New)', '<p>\r\n	General</p>\r\n<p>\r\n	The Fuji Nevada 2.0 is a 26 inch Hardtail bike, which is the average for all Cross Country Mountain Bikes (MTB).</p>\r\n<p>\r\n	The bike weighs 32 pounds, which is 4 pounds heavier than the average for all Mountain Bikes (MTB). i think this is a size 19 or 21 Frame size.</p>\r\n<p>\r\n	The 2012 Fuji Nevada 2.0 costs $829, which is moderately less expensive than the average for all Cross Country Mountain Bikes (MTB).</p>\r\n', 1, 9, 1, 20, '2013-04-01', '0000-00-00', 2, 2, 1, 'Gateway Boulevard', '', '', '', '', '', '', '', '', '', 0, 1, 0, '2013-04-29', 0),
(6, 'stunning lavendar dress, size small, utra feminine', '<p>\r\n	gorgeous color, size small, should fit size 5/6 and size 7/8, poly but it&#39;s a very soft elegant poly, ultra ffeminine and in great condition</p>\r\n', 1, 11, 1, 20, '2013-04-01', '0000-00-00', 8, 1, 0, 'Gateway Boulevard', '', '', '', '', '', '', '', '', '', 12, 1, 0, '2013-04-29', 0),
